import React from "react";
import { useHistory } from "react-router";

export const Logout = () => {
  const [error, setError] = useState("");
  const { currentUser, logout } = useAuth();
  const history = useHistory();

  async function handleLogout() {
    setError("");
    try {
      await logout();
      history.push("/login");
    } catch {
      setError("failed to log out");
    }
  }
};
